INSERT INTO `wp_posts` VALUES (1,1,'2017-11-16 14:47:09','2017-11-16 14:47:09','Welcome to WordPress. This is your first post. Edit or delete it, then start writing!','Hello world!','','publish','open','open','','hello-world','','','2017-11-16 14:47:09','2017-11-16 14:47:09','',0,'http://wpengine.com9/?p=1',0,'post','',1),(2,1,'2017-11-16 14:47:09','2017-11-16 14:47:09','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://wpengine.com9/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','publish','closed','open','','sample-page','','','2017-11-16 14:47:09','2017-11-16 14:47:09','',0,'http://wpengine.com9/?page_id=2',0,'page','',0),(3,2,'2018-12-11 17:43:01','0000-00-00 00:00:00','','Auto Draft','','auto-draft','open','open','','','','','2018-12-11 17:43:01','0000-00-00 00:00:00','',0,'http://beachab.wpengine.com/?p=3',0,'post','',0),(6,2,'2018-12-11 17:54:37','2018-12-11 17:54:37','','Espresso','','inherit','open','closed','','espresso','','','2018-12-11 17:54:37','2018-12-11 17:54:37','',0,'http://beachab.wpengine.com/wp-content/uploads/2018/12/espresso.jpg',0,'attachment','image/jpeg',0),(7,2,'2018-12-11 17:54:37','2018-12-11 17:54:37','','Sandwich','','inherit','open','closed','','sandwich','','','2018-12-11 17:54:37','2018-12-11 17:54:37','',0,'http://beachab.wpengine.com/wp-content/uploads/2018/12/sandwich.jpg',0,'attachment','image/jpeg',0),(8,2,'2018-12-11 17:54:37','2018-12-11 17:54:37','','Coffee','','inherit','open','closed','','coffee','','','2018-12-11 17:54:37','2018-12-11 17:54:37','',0,'http://beachab.wpengine.com/wp-content/uploads/2018/12/coffee.jpg',0,'attachment','image/jpeg',0),(9,2,'2018-12-11 17:54:37','2018-12-11 17:54:37','Welcome to your site! This is your homepage, which is what most visitors will see when they come to your site for the first time.','Home','','publish','closed','closed','','home','','','2018-12-11 17:54:37','2018-12-11 17:54:37','',0,'http://beachab.wpengine.com/?page_id=9',0,'page','',0),(10,2,'2018-12-11 17:54:37','2018-12-11 17:54:37','You might be an artist who would like to introduce yourself and your work here or maybe you&rsquo;re a business with a mission to describe.','About','','publish','closed','closed','','about','','','2018-12-11 17:54:37','2018-12-11 17:54:37','',0,'http://beachab.wpengine.com/?page_id=10',0,'page','',0),(11,2,'2018-12-11 17:54:37','2018-12-11 17:54:37','This is a page with some basic contact information, such as an address and phone number. You might also try a plugin to add a contact form.','Contact','','publish','closed','closed','','contact','','','2018-12-11 17:54:37','2018-12-11 17:54:37','',0,'http://beachab.wpengine.com/?page_id=11',0,'page','',0),(12,2,'2018-12-11 17:54:37','2018-12-11 17:54:37','','Blog','','publish','closed','closed','','blog','','','2018-12-11 17:54:37','2018-12-11 17:54:37','',0,'http://beachab.wpengine.com/?page_id=12',0,'page','',0),(13,2,'2018-12-11 17:54:37','2018-12-11 17:54:37','This is an example of a homepage section. Homepage sections can be any page other than the homepage itself, including the page that shows your latest blog posts.','A homepage section','','